('04a3ec74-3e15-4b3f-b341-1da825f5a667', 'eb441095-c9ba-4f85-88c5-54fcc0a3413e', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Nyeri ulu hati, kontrol tekanan darah, nyeri pinggang', 'Ranitidin 2x1\r\nAs. Mefenamat 3x1\r\nAmlodipin 1x10mg\r\nCaptopril 2x25mg\r\nVit b komp 3x1'),
('3062c504-1897-46b6-84b8-5487e59d287d', '70a9cb25-cee0-4de6-b3f4-a236923b9d48', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Sakit perut bawah\r\n', 'Mini aspi 1x80 mg\r\nNifedipine 3x10 mg\r\nTTD 2x1 tab'),
('52f8499b-81cf-4856-8f0b-d225703c6238', '10157419-084d-4bb8-a1fc-82a40c91d544', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Tidak ada keluhan', 'Tablet tambah darah 2x1 tab\r\nKalsium laktat 3x500 mg'),
('5ad9f6a9-da0b-4dd0-b6a3-2c8d3c42c5c2', '144cb8b6-9607-4181-b88e-0c992f5ef8e9', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Kontrol tekanan darah tinggi, sakit kepala sebelah bagian kiri', 'Amlidipin 5mg 1x1\r\nIbuprofen 3x400 mg\r\nVit b komp 3x1 tab'),
('6373b696-2eaa-499f-a868-510171325f89', '9aaacb15-370c-4ad7-a195-7c201734c762', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Pilek sekak 1 minggu yang lalu. Pilek berwarna kekuningan. Demam (+)\r\nBatuk (-), nyeir tenggorokan\r\nRiw. Kontak erat pasien susp/terkonfirmasi covid 19 (-)\r\nRiw berpergian ke wilayan transmisi lokal covid 19(-)', 'Amoksisilin 3 x 500 mg\r\nPct 3 x 500 mg\r\nCTM 3 x 4mg\r\nVit c 1 x 250 mg'),
('6cae92f8-ddaa-48a1-96cb-2c9f3688fcbe', '96a0a234-0c6f-4ca4-a0f3-ef5f6798f235', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Kontrol', 'Clobazam 1x10 mg\r\nDiazepam 2x2mg\r\nAntasida 3x1'),
('77a1947f-8840-42c3-9ecd-ecb3cfb96d8e', '56616999-28a7-4969-aae7-ff61f6e0090f', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Gatal-gatal dan kemerahan dileher dan bokong. Makin gatal saat berkeringat.', 'Salep ketokonazole 2 x 1\r\nCetirizine syr 1 x 1 cth'),
('8e8a50a2-32f1-41c3-8c71-d72bb57e8986', '27450a68-e317-483d-80ab-27de90450ff1', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Mual dan muntah disertai pusing sejak 1 bulan.', 'Tablet tambah darah 1x1 tab po\r\nAs folat 1x400 ug po\r\nVitamin B6 3x1 tab po\r\nAntasida syrup 3x1C\r\n'),
('8fe010a8-f6ac-41fd-8efe-4aff00744ec3', '449ac1f7-d550-4e82-9c24-f6814916b7cf', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Menyesak, sakit tenggorokan, sakit menelan', 'As.mefenamat 3x1 tab\r\nMP tab 4mg 3x1\r\nRanitidin tab 2x1\r\nAntasida tab 3x1'),
('99ba5560-f736-4353-a392-d8a53825031f', '35c5f001-db75-4e23-a8af-2e8036a70ef5', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Nyeri diantara leher dan bahu', 'Ibuprofen 3x1 sesudah makan\r\nVit b komplek 3x1'),
('a3c370a1-392e-4a12-a109-22e6bf9a7eb8', 'e302d495-57bb-4fd4-bf66-e1a133b92c90', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Batuk dan pilek sejak 2 hari yang lalu. Demam (-) sesak (-)\r\nKejang (-)\r\nTelinga kiri terasa penuh. Keluar cairan (-)', 'Dextrofen 3 x 1 cth\r\nPulv : 1 x 1\r\nMP 4 mg\r\nVit C 50 mg\r\n\r\n-phenylglycerol 2 x 1'),
('aa4ab422-51fd-4392-90ef-5390b4894481', '9e37cb88-1c67-4384-9c75-f2c2a6b2eaa4', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Mules ingin melahirkan', 'Amoxicillin 3x500 mg\r\nAs. Mefenemat 3x500 mg\r\nTTD 2x1 tab \r\nVit. B kompleks 1x1 tab\r\nVitamin A 1 tab dosis tunggal'),
('b7bc03d3-8051-41d3-bce5-e6a2e0281e84', '35f72a49-74a2-456f-a996-6be64adf5e8e', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Tidak ada keluhan. Jarak kehamilan anak kedua dengan kehamilan saat ini lebih dari 10 tahun.', 'Tablet tambah darah 2x1 tab\r\nKalk 3x500 mg\r\nVitamin B kompleks 1x1 tab'),
('c7e2dc46-2c8e-4b66-998d-95ea4cb22ffa', 'edc729df-74d2-4e6d-97e4-59f7da61102c', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Tangan dan kaki kesemutan, bahu kanan nyeri bila digerakkan dan mengangkat berat', 'As.mefenamat 3x500mg sesudah makan\r\nVit b komp 3x1\r\nPct bila demam'),
('dd601c8b-3217-4c01-8e24-fec63181c97b', '460297b8-c0d4-46eb-b3f0-7d210eec620a', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Keputihan sejak 1 bulan yang lalu. Keputihan berwarna putih, gatal dan berbau.  Riw DM tidak diketahui. Riw keluarga dengan DM (+)', '2 x 500 mg selama 7 hari'),
('dea7df7d-4f36-4d18-bce1-3698ecb6f189', 'd48af2d4-6fce-44a5-bec7-772f83ffc958', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Kontrol tekanan darah, badan ngilu', 'Amlodipin 1x1 pagi\r\nAs.mefenamat 3x500 mg sebelum makan\r\nVit b komp 3x1'),
('e1896a75-d8cb-437e-95b6-5c69d779f64c', '78500363-8f3a-4315-926c-1c57a19d99f9', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Nyeri pada kedua lutut. Gatal pada kaki kanan', 'Natrium diclofenac 2x1\r\nRanitidin 2x1\r\nVit bkomp 3x1\r\nBetametason cream 2x1\r\nAmoxicillin 3x1'),
('e3cfa133-78b4-4bd5-89d1-9e1315094a57', '434eb40c-c2b9-4ae1-97f3-1dea67108a0f', '42103a6b-9303-4744-94c6-5f423c5a99a7', 'Nyeri ulu hati, mual (-), muntah (-)\r\nNyeri dada seperti tertindih (-)\r\nRiw minum obat anti nyeri berulang.\r\nPasien mengeluhkan nyeri pada punggung kiri, tifak dipengaruhi gerakan. Riw trauma (-)\r\n\r\nEKG: sinus rhytm', 'Antasida 3 x 1 tab\r\nPCt 3 x 500 mg\r\nVit b complex 3 x 1'),
('eba7266a-f4cb-4c72-b714-41478dc17b1b', 'e289f4b7-ed6e-4e02-b383-289d00a30054', '54cde188-40b6-4092-9b95-afb9fa767fbe', 'Kedua lutut sakit,kesemutan, riwayat darah tinggi dan dm terkontrol', 'Metformin 3x500mg\r\nCaptopril3x25mg\r\nAmlodipin 1x5mg\r\nSimvastatin 1x20mg\r\nVit b komp 3x1\r\nAs mefenamat 3x1');
